import React from 'react';
import { BrowserRouter, Route, Routes } from 'react-router-dom';
import Layout from './components/layout/Layout';
import './styles/animations.css';

// Import all pages
import MainPage from './pages/MainPage';
import Goals from './pages/Personal/Goals';
import InternshipJourney from './pages/Personal/InternshipJourney';
import University from './pages/Personal/University';
import Logbook from './pages/Personal/Logbook';
import AILab from './pages/Labs/AI';
import Automation from './pages/Labs/Automation';
import DataViz from './pages/Labs/DataViz';
import Brainstorming from './pages/Labs/Brainstorming';
import Projects from './pages/Labs/Projects';
import ContractDetails from './pages/Contract/Details';
import GitHub from './pages/Contract/GitHub';

function App() {
  return (
    <BrowserRouter>
      <Routes>
        <Route path="/" element={<Layout />}>
          <Route index element={<MainPage />} />

          {/* Personal Routes */}
          <Route path="/personal/internship" element={<InternshipJourney />} />
          <Route path="/personal/goals" element={<Goals />} />
          <Route path="/personal/university" element={<University />} />
          <Route path="/personal/logbook" element={<Logbook />} />

          {/* Labs Routes */}
          <Route path="/labs/ai" element={<AILab />} />
          <Route path="/labs/automation" element={<Automation />} />
          <Route path="/labs/dataviz" element={<DataViz />} />
          <Route path="/labs/brainstorming" element={<Brainstorming />} />
          <Route path="/labs/projects" element={<Projects />} />

          {/* Contract Routes */}
          <Route path="/contract/details" element={<ContractDetails />} />
          <Route path="/contract/github" element={<GitHub />} />
        </Route>
      </Routes>
    </BrowserRouter>
  );
}

export default App;
